<script>
window.onload = function()
{
    img = document.getElementById("img");
    canvas = document.getElementById("canvas");
    ctx = canvas.getContext("2d");
    overlay = document.getElementById("overlay");
    otx = overlay.getContext("2d");
    window.onresize();
    nx = 32; ny = 18;
    n = nx * ny;
    mx = hw; my = hh;
    setInterval(draw, 10);
}

window.onresize = function()
{
    var style = window.getComputedStyle(canvas);
    w = canvas.width = overlay.width = parseFloat(style.width);
    h = canvas.height = overlay.height = parseFloat(style.height);
    hw = w / 2; hh = h / 2;
}

draw = function(q = 1.0)
{
    canvas.width = canvas.width;
    ctx.fillStyle = "#000";
    ctx.fillRect(0, 0, w, h);
    wn = w / nx; hn = h / ny;
    zi = new Int32Array(n);
    zd = new Float32Array(n);
    for (var i = 0; i < n; ++i)
    {
        x = parseInt(i % nx);
        y = parseInt(i / nx);
        ox = x * wn; oy = y * hn;
        dx = mx - ox - (wn / 2);
        dy = my - oy - (hn / 2);
        c = Math.sqrt(Math.pow(dx, 2) + Math.pow(dy, 2));
        zd[i] = 255 - parseInt(c);
        zi[i] = i; //n - i - 1;
    }
    for (var i = 0; i < (n - 1); ++i)
    {
        for (var j = 0; j < (n - 1); ++j)
        {
            if (zd[j] > zd[j + 1])
            {
                var tmp = 0;
                tmp = zd[j];
                zd[j] = zd[j + 1];
                zd[j + 1] = tmp;
                tmp = zi[j];
                zi[j] = zi[j + 1];
                zi[j + 1] = tmp;
            }
        }
    }
    for (var j = 0; j < n; ++j)
    {
        var i = zi[j];
        x = parseInt(i % nx);
        y = parseInt(i / nx);
        ox = x * wn; oy = y * hn;
        dx = mx - ox - (wn / 2);
        dy = my - oy - (hn / 2);
        c = Math.sqrt(Math.pow(dx, 2) + Math.pow(dy, 2));
        r = 255 - parseInt(c); g = 0; b = 0; a = 1.0;
        mc = q * Math.min(Math.max(parseFloat(r) / 255, 0), 1);
        ox -= (dx * mc); oy -= (dy * mc);
        ctx.fillStyle = "#123456"; //"rgba(" + r + ", " + g + ", " + b + ", " + a + ")";
        ctx.fillRect(ox, oy, wn, hn);
        otx.drawImage(img, ox, oy, wn, hn);
        otx.fillStyle = "#FFF";
        otx.font = "20pt consolas";
        otx.textAlign = "center";
        otx.textBaseline = "middle";
        otx.fillText(hex_encode(r), ox + wn/2, oy + hn/2, wn, hn);
    }
}

window.onmousemove = function(event)
{
    mx = event.x;
    my = event.y;
}

hex_encode = function(xy)
{
    xy = (xy < 0x00) ? 0x00 : (xy > 0xFF) ? 0xFF : xy;
    lo = (xy       ) & 0x0F;
    hi = (xy >>   4) & 0x0F;
    hex_map = "0123456789ABCDEF";
    return hex_map[hi] + hex_map[lo];
}
</script>

</style>
